import React from "react";
import './card-list.styles.css'

import {Card} from '../singleCard/card-component'

export const CardList = (props)=>{

    return(
        <div className='card-list'>
            {props.heroes.map(hero=>
              <Card key={hero.id}/> )} </div>
    )


}
